import { FC } from "react";
import { useKeyboardForm } from "../../lib/keyboardFormStore";
import { Flex, BorderBox, Sans } from "@rsbear/betsy";
import { ITheme } from "../../lib/types";
import { useTheme } from "emotion-theming";

interface P {
  setStepOneComplete: Function;
}

const StepOne: FC<P> = ({ setStepOneComplete }) => {
  const { values, setString } = useKeyboardForm();
  const theme: ITheme = useTheme();

  return (
    <div>
      <BorderBox p="20px" border={`solid 1px ${theme.colors.dividerColor}`}>
        <Sans fontWeight={600}>Name &amp; Brand</Sans>
        <Flex>
          <input
            type="text"
            placeholder="Name"
            name="name"
            value={values.name}
            onChange={(e) => setString(e)}
          />
          <input
            type="text"
            placeholder="brand"
            name="brand"
            value={values.brand}
            onChange={(e) => setString(e)}
          />
        </Flex>
      </BorderBox>

      <Flex>
        <input
          type="text"
          placeholder="size"
          name="size"
          value={values.size}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="mount"
          name="mount"
          value={values.mount}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="typing angle"
          name="angle"
          value={values.angle}
          onChange={(e) => setString(e)}
        />
      </Flex>

      <Flex>
        <input
          type="text"
          placeholder="connection"
          name="connection"
          value={values.connection}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="pcb"
          name="pcb"
          value={values.pcb}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="firmware"
          name="firmware"
          value={values.firmware}
          onChange={(e) => setString(e)}
        />
      </Flex>

      <p>do you want to provide colors</p>

      <button onClick={() => setStepOneComplete()}>next</button>
    </div>
  );
};

export default StepOne;
